const t=JSON.parse('{"key":"v-5ad99f25","path":"/posts/tool/git/git-proxy.html","title":"Linux、MacOS","lang":"zh-CN","frontmatter":{"description":"设置https 代理 Git代理有两种设置方式，分别是全局代理和只对Github代理，建议只对github 代理。 代理协议也有两种，分别是使用http代理和使用socks5代理，建议使用socks5代理。 注意下面代码的端口号需要根据你自己的代理端口设定，比如我的代理socks端口是51837。 全局设置（不推荐） 使用http代理 git config --global http.proxy http://127.0.0.1:58591 git config --global https.proxy https://127.0.0.1:58591","head":[["meta",{"property":"og:url","content":"https://mister-hope.github.io/posts/tool/git/git-proxy.html"}],["meta",{"property":"og:site_name","content":"Code Building"}],["meta",{"property":"og:title","content":"Linux、MacOS"}],["meta",{"property":"og:description","content":"设置https 代理 Git代理有两种设置方式，分别是全局代理和只对Github代理，建议只对github 代理。 代理协议也有两种，分别是使用http代理和使用socks5代理，建议使用socks5代理。 注意下面代码的端口号需要根据你自己的代理端口设定，比如我的代理socks端口是51837。 全局设置（不推荐） 使用http代理 git config --global http.proxy http://127.0.0.1:58591 git config --global https.proxy https://127.0.0.1:58591"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2024-01-23T08:27:37.000Z"}],["meta",{"property":"article:modified_time","content":"2024-01-23T08:27:37.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Linux、MacOS\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2024-01-23T08:27:37.000Z\\",\\"author\\":[]}"]]},"headers":[],"git":{"createdTime":1705978300000,"updatedTime":1705998457000,"contributors":[{"name":"zgjsxx","email":"119160524@qq.com","commits":2}]},"readingTime":{"minutes":1.98,"words":594},"filePathRelative":"posts/tool/git/git-proxy.md","localizedDate":"2024年1月23日","excerpt":"<p>设置https 代理</p>\\n<p>Git代理有两种设置方式，分别是全局代理和只对Github代理，建议只对github 代理。\\n代理协议也有两种，分别是使用http代理和使用socks5代理，建议使用socks5代理。\\n注意下面代码的端口号需要根据你自己的代理端口设定，比如我的代理socks端口是51837。</p>\\n<p>全局设置（不推荐）</p>\\n<p>使用http代理</p>\\n<div class=\\"language-bash line-numbers-mode\\" data-ext=\\"sh\\"><pre class=\\"language-bash\\"><code><span class=\\"token function\\">git</span> config <span class=\\"token parameter variable\\">--global</span> http.proxy http://127.0.0.1:58591\\n<span class=\\"token function\\">git</span> config <span class=\\"token parameter variable\\">--global</span> https.proxy https://127.0.0.1:58591\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div>","autoDesc":true}');export{t as data};
